import React from "react";
import styles from "styles/SingleProduct.module.css";
import MaxContentWidth from "components/Layout/MaxWidthContainer";

const SingleProduct = () => {
  return (
    <>
    <MaxContentWidth>
      <div className={styles.SingleProduct}>
        <h3>Single</h3>
      </div>
      </MaxContentWidth>
    </>
  );
};

export default SingleProduct;
